import _ from 'lodash';
import getModified from './get_modified.js';

function isModified(options = {}) {
	let {
		doc,
		pattern,
		transient = false,
		immutable = false
	} = options;

	let modified = getModified({
		doc,
		transient,
		immutable
	});

	if (pattern) {
		return _.includes(modified, pattern);
	}
	else {
		return modified.length > 0;
	}
};

export default isModified;
